import { useState, useEffect } from 'react';
import axios from 'axios';

function App() {


  const [getNotes, setNotes] = useState(['Nothing found.'])
  let notes = `i'm empty though`;

  useEffect(() => {
    axios.get(`https://restcountries.com/v3.1/all`).then((response) => {
      notes = response.data;
      console.log(notes[0])
      setNotes(notes[0])
      console.log(getNotes)
    }).catch((response) => {
      console.log('did not receive shieeet')
    })
  }, [])

  useEffect(() => { console.log('entering use effect') }, [])
  return (
    <>
      <>
        <h1>Work in Progress!</h1>
      </>
      <>
        <ul>{getNotes.map(countryObject => {
          return <li>{countryObject.name.common}</li>;
        }
        )}</ul>
      </>
    </>
  )
}


export default App;
